import { useNavigate } from "react-router-dom";

export default function Build() {
  const interests = ["Technology"];

  return (
    <div className="flex flex-col items-center justify-center min-h-screen p-4">
      <div className="w-full md:w-1/2 mb-8">
        <h1 className="gradient-text font-bold text-4xl mb-4">
          Let's find your interests first.
        </h1>
        <p className="text-white mb-8">What do you love to do? You can click on up to three interests!</p>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <div className="bg-neutral-800 rounded-lg shadow-lg overflow-hidden hover:scale-105 transition-all size-full">
            <div className="p-4">
              <h3 className="text-lg font-semibold gradient-text">Technology</h3>
              <br />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
